/**
 * PDF Brand Assets — Helix Law
 * 
 * Contains base64-encoded brand assets for jsPDF generation:
 * - Raleway Regular + Bold TTF (from Google Fonts)
 * - Helix Law logos (white on dark, blue on light, colour mark)
 * 
 * Generated by scripts/temp-generate-pdf-assets.mjs
 * Do not edit manually.
 */

// ── Raleway Font (TTF base64) ──

/** Raleway Regular 400 — TTF base64 */
export const RALEWAY_REGULAR_B64 = '';

/** Raleway Bold 700 — TTF base64 */
export const RALEWAY_BOLD_B64 = '';

// ── Logo Assets (PNG base64 data URIs) ──

/** Helix Law logo — white on transparent (72px), for dark backgrounds */
export const HELIX_LOGO_WHITE_B64 = 'data:image/png;base64,';

/** Helix Law logo — blue on transparent (72px), for light backgrounds */
export const HELIX_LOGO_BLUE_B64 = 'data:image/png;base64,';

/** Helix colour mark — small icon (192px), for compact usage  */
export const HELIX_MARK_COLOUR_B64 = 'data:image/png;base64,';

// ── jsPDF registration helper ──

/**
 * Register Raleway Regular + Bold with a jsPDF instance.
 * Call once per doc before using setFont('Raleway', ...).
 */
export function registerRaleway(doc: any): void {
  doc.addFileToVFS('Raleway-Regular.ttf', RALEWAY_REGULAR_B64);
  doc.addFont('Raleway-Regular.ttf', 'Raleway', 'normal');
  doc.addFileToVFS('Raleway-Bold.ttf', RALEWAY_BOLD_B64);
  doc.addFont('Raleway-Bold.ttf', 'Raleway', 'bold');
}
